// src/AppRoutes.jsx (CORREGIDO)

import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import MainLayout from './MainLayout';
import Dashboard from './Dashboard';
import Tareas from './Tareas';

// ... (la firma de la función se queda igual)
function AppRoutes({ token, onLogout, movimientos, taskToEdit, setTaskToEdit, onTaskUpdate, refreshKey, ...authProps }) {
  return (
    <Routes>
      <Route
        path="/"
        element={
          <MainLayout 
            token={token} 
            onLogout={onLogout} 
            taskToEdit={taskToEdit}
            onTaskUpdate={onTaskUpdate}
            movimientos={movimientos} // <-- ASEGÚRATE DE PASAR ESTA PROP AQUÍ
          />
        }
      >
        <Route 
          index 
          element={
            <Dashboard 
              token={token} 
              movimientos={movimientos} // Esto ya estaba bien
              {...authProps} 
            />
          } 
        />
        <Route
          path="notas"
          element={
            token ? (
              <Tareas 
                token={token} 
                refreshKey={refreshKey} 
                onEditClick={setTaskToEdit} 
              />
            ) : (
              <Navigate to="/" />
            )
          }
        />
      </Route>
      <Route path="*" element={<Navigate to="/" />} />
    </Routes>
  );
}

export default AppRoutes;
